import React, { useState } from 'react';
import "./todo.css"
function Todo(props){
    return(
        <div className='main' onClick={props.func}>
            {props.isFinished?
            <div className='containerTrue container'>
                a
            </div>
            :
            <div className='containerFalse container'>
                 {props.name}
            </div>}
        </div>
    )
}
export default Todo;
